const calDefaultValueObj={};window.addEventListener("DOMContentLoaded",()=>{document.querySelectorAll(".homeloancalculator .calctabs .commoncalculator").forEach((e,l)=>{const t=`calid-${l}`;e.dataset.resetId=t,calDefaultValueObj[t]=Object.fromEntries([...e.querySelectorAll("input[type=range]")].map(a=>[a.id,a.value]))}),sessionStorage.setItem("calDefaultValueObj",JSON.stringify(calDefaultValueObj))});
